Luk 8 Na koi Vaivine kena Ado Hathea a Jisas 1Leghugna iaani, a Jisas ke vano tadia na komi meleha hutu ma na komi meleha iso i Galili eigna kena titionoa na Rorongo ke Toke eigna na puhi a God ke vunaghi pungusira na komi tinoni. Mara e salaghe rua nigna na komi vaovarongo kena duagna. 2Kekeha koi vaivine a Jisas ke gigi aura na komi tidatho itadia, mi kekeha ke vatoke tabirura tadia na komi vahaghi kena vano duagna. Kekeha itadia, a Meri Magdala, a Jisas ke gigi aura e vitu na tidatho itagna; 
..........
 vido iangeni, na ghuri ke soto ma na kolo ke sola. 25Gi e velera nigna na komi vaovarongo, “Ehava gi oti boi vaututuniu?” Imarea kena vere nidia puala mena mataghu. Gi ena veihuahuatighi, “Na tinoni hava hina iaani? Imanea ke haghore vanira na ghuri ma na geo mena leghua na haghoregna.” A Jisas ke Vatoke Tabirua na Mane ke Haghevia na komi Tidatho (Matiu 8:28-34; Mak 5:1-20) 26A Jisas duagna nigna na komi vaovarongo kena vano jufu kori melehadia mara Gerasa sethevugna na kolo i Galili. 27Kori v
